import styled from "styled-components"
import CicleProgress from "./CicleProgress"
import ShareLine from "./ShareLine"


const Container = styled.div`
    font-family: WantedSans-Regular;
    margin-top : 40px;
    font-size : 16px;
    padding : 5px;

`

const Range = styled.div`
display : flex;
flex-derection : row;
justify-content : space-around;

`

function Stack() {

    return (
        <Container>
            <ShareLine title="My Stacks" />
            <Range>
                <CicleProgress percent={100} title={"Back End"} color={"#3A00F5"} />
                <CicleProgress percent={80} title={"Fornt End"} />
                <CicleProgress percent={50} title={"DevOps"} />
            </Range>

        </Container>
    )
}

export default Stack
